import React from "react";

//material-ui
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";

//COMPONENT
import { Card } from './card'

export const Main = () => {
  return (
    <div className="main">
      <React.Fragment>
        <Container
          justify='center'
          maxWidth="md"
          style={{ backgroundColor: "lightgrey", height: "100vh" }}
        >
          <Grid container >

            <Card/>

          </Grid>
        </Container>
      </React.Fragment>
    </div>
  );
};
